description:
"Да елиминираме домашното насилие!" е част от кампанията на Ротаракт клуб - Велико Търново, посветена на Международния ден за елиминиране на насилието срещу жените (25.11).

Поредицата от епизоди представя:
• Експертното мнение на психотерапевти с опит в областта;
• Историите на жени, които са преодолени това предизвикателство в живота си;
• Правния аспект на темата в разговор с юрист;
• Дейността на институции, асоциации и други организации, които предоставят помощ на жени, които са изпаднали в ситуация на домашно насилие.
